import React from 'react';

import { CustomButtonComponent } from './custom-button.styles';

const CustomButton = ({
  children,
  isGoogleSignIn,
  inverted,
  ...otherProps
}) => (
  <CustomButtonComponent
  >
    {children}
  </CustomButtonComponent>
);

export default CustomButton;
